import './App.css';
import Header from "./Components/Header.js"
import {BrowserRouter as Router, Routes, Route} from "react-router-dom"
import Container from 'react-bootstrap/Container';

function App() {
  return (
    <Router>
      <Header/>
      <main className='py-3'></main>
      <Container>
        <Routes>
          <Route path='/' element></Route>
        </Routes>
      </Container>

    </Router>
  );
}

export default App;
